import React from 'react';
import './App.css';
import Navbar from './Navbar';

function Services() {
  return (
        <> 
        <Navbar/>
        <div className="my-5">
             <h2 className="text-center">Our Services</h2>
        </div>
        <div className="container-fluid mb-3">
           <div className="row">
              <div className="col-10 mx-auto">

              </div>

           </div>

        </div>

        </>

  );
}

export default Services;
